import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import ProgressBar from 'react-bootstrap/ProgressBar';

const categories = [
  { name: "Web Exploitation", progress: 60, color: "success" },
  { name: "Cryptography", progress: 40, color: "info" },
  { name: "Network Security", progress: 80, color: "warning" },
  { name: "Reverse Engineering", progress: 20, color: "danger" },
  { name: "Binary Exploitation", progress: 100, color: "primary" },
];

const LandingPage = () => {
  return (
    <Container className="mt-4">
      <h1 className="text-center">Progress Overview</h1>
      <Row className="mt-4 d-flex justify-content-center align-items-center" style={{ height: "100%" }}>

        <Col>
          {categories.map((category, index) => (
            <div key={index} className="mb-3">
              <h5>{category.name}</h5>
              <ProgressBar
                now={category.progress}
                label={`${category.progress}%`}
                variant={category.color} // Use the color from the category
                style={{ height: '30px' }} // Set a height for the progress bar
              />
            </div>
          ))}
        </Col>
      </Row>
    </Container>
  );
};

export default LandingPage;
